export function ImageQuiz(path) {
    let text = "";
    path.keys().map((item) => { text[item.replace('\t', '')] = path(item); });
    //path.keys().map((item) => { text[item.replace('\n', '')] = path(item); });
    console.log(path.endsWith('?'));
    let isQuestion = path.endsWith("?");
    
    return (
        <div>
            {
                isQuestion ? 
                (
                    <div>
                        {path}
                    </div>
                ):(
                <div className="topping">
                    <input type="checkbox" id={path} name="topping" value={path} />{path}
                </div>
                )
            }
        </div>
    );
}
